import * as React from 'react';
import '../btnStyle.css'

const Button = (props) => {
	return (
		<button type='submit' className="wave-btn">
			<span className="wave-btn__text">{props.text}</span>
			<span className="wave-btn__waves"></span>
		</button>
	)
}

export default React.memo(Button);
